import React from "react";
import { Link, NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <nav class="navbar navbar-light bg-light justify-content-between">
      <a class="navbar-brand">Traffic Playback</a>
    </nav>
  );
};

export default NavBar;
